  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Potomac
  River National Wildlife Refuge Complex outlines Refuge accomplishments during the
  2012 calendar year. The report begins with a summary of the year's highlights and
  personnel. The report includes a planning section which highlights the Potomac Heritage
  and National Scenic Trail and the Occoquan Bay NWR Road Project. Visitor Services
  is outlined and special events/programs are highlighted. Law enforcement is also
  covered with details of violations.  The equipment and facilities section of the
  report provides information about major maintenance, rehabilitation, equipment replacement,
  computer systems, and energy conservation. Topics covered under wildlife and habitat
  management include grassland/shrubland management, impoundment and water level management,
  the big game hunt, hemorrhagic disease, invasive plant species management, bird
  banding, research and monitoring, and other unusual wildlife sightings.\",\n\t\"owner_org\":
